import React from 'react';
import axios from 'axios';
import { List, Typography } from 'antd';

const admin = () => {
    let data = [];
    data = axios.get('http://localhost:3065/api/agari/');
    return (
        <>
            <div>
                <h3 style={{ margin: '16px 0' }}>신청자 목록</h3>
                <ul>
                    <li key={data.phone}>{data.name}</li>
                </ul>
            </div>  
        </>
    )
}

export default admin;
